import { styled } from "styled-components"

const StyledModalWindow = styled.dialog`
  text-align: center;
  top: 1rem;
  width: 60%;
  height: 60%;
  background-color: rgb(201 201 201);
  border: 2px solid #212529;
  border-radius: 0.5rem;
  & h2 {
    font-size: 3.5rem;
  }
  & h3 {
    font-size: 14.5rem;
  }
  & p {
    font-size: 1.5rem;
  }
`

export default function ModalWindow({ children }) {
  return <StyledModalWindow open>{children}</StyledModalWindow>
}
